import base64
from io import BytesIO
from PIL import Image


def base64toimageobj(imagebase64str):
  data=imagebase64str.split(',')[1]
  image_bytedecoded=base64.b64decode(data)
  img=Image.open(BytesIO(image_bytedecoded))
  return img

